import React, { useState } from 'react';
import { Phone, Users } from 'lucide-react';
import DialPad from './DialPad';
import Contacts1 from './Contacts1';

const NewUI = () => {
  const [activeTab, setActiveTab] = useState('dialpad');

  return (
    <div className="min-h-screen bg-gradient-to-r from-blue-100 via-gray-50 to-blue-100 flex items-center justify-center p-6">
      <div className="bg-white rounded-lg shadow-lg w-full h-1 max-w-4xl overflow-hidden">
        {/* Tab Buttons */}
        <div className="flex justify-center space-x-6 p-4 bg-gray-100 border-b border-gray-200">
          <button
            className={`flex items-center justify-center px-5 py-2 rounded-full transition-all duration-200 ${
              activeTab === 'dialpad'
                ? 'bg-blue-500 text-white shadow-md'
                : 'bg-white text-gray-700 hover:bg-blue-100'
            }`}
            onClick={() => setActiveTab('dialpad')}
          >
            <Phone className="mr-2" size={20} />
            Dialpad
          </button>
          <button
            className={`flex items-center justify-center px-5 py-2 rounded-full transition-all duration-200 ${
              activeTab === 'contacts'
                ? 'bg-blue-500 text-white shadow-md'
                : 'bg-white text-gray-700 hover:bg-blue-100'
            }`}
            onClick={() => setActiveTab('contacts')}
          >
            <Users className="mr-2" size={20} />
            Contacts
          </button>
        </div>

        {/* Content Area */}
        <div className="p-0">
          {activeTab === 'dialpad' ? (
            <div className="p-2">
              <DialPad />
            </div>
          ) : (
            <div className="p-6">
              <Contacts1 />
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default NewUI;
